function searchProductByName(pattern, callback) {
	readAll("tableProduct", list => {
		let productList = [];
			
		for(let i in list) {
			if (list[i].name.search(pattern) >= 0) {
				productList.push(list[i]);
			}
		};
		callback(productList);
	});
}
