function recentlyAdded(callback) {
	readAll("tableProduct", productList => {
		readAll("tableService", serviceList => {
			productList.reverse();
			serviceList.reverse();
			productList.slice(0, 5);
			serviceList.slice(0, 5);
			callback(productList, serviceList);
		});
	});
}

